import '../css/main.css';
import '../css/headerNav.css';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-boostrap/NavDropDown'
import {
  Link
} from "react-router-dom";

function HeaderNav() {
  return (
    <div>
      <div className="bar" />
      <Navbar id="navbar-container" variant="light pills" expand="sm">
        <Navbar.Toggle id="toggle"/>
        <Navbar.Collapse>
          <Nav id="nav">
            <Nav.Item className="pill">
              <Nav.Link className="text"><Link to="/">Home</Link></Nav.Link>
            </Nav.Item>
            <Nav.Item className="pill">
              <Nav.Link className="text"><Link to="/">Home</Link></Nav.Link>
            </Nav.Item>
            <Nav.Item className="pill">
              <Nav.Link className="text"><Link to="/">Home</Link></Nav.Link>
            </Nav.Item>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
      <div className="bar" />
     </div>
  );
}

export default HeaderNav;
